import React, { Component } from 'react';
import './App.css';
import { BrowserRouter, Switch } from 'react-router-dom';
import PrivateRoute from './routes/PrivateRoute';
import PublicRoute from './routes/PublicRoute';
import store from './redux/store'
import { Provider } from 'react-redux'
import Dashboard from './components/Dashboard/dashboard';
import SignIn from './components/Auth/SignIn/SignIn'
import Registration from './components/Auth/Registration/registration'
import { storeData } from './utils/asyncKeyStorage';

class App extends Component {

  render() {
    // storing the bearer token , as per there are no requirement for registration
    storeData('token', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImdhdXJhdmJsYWNrY29kQGdtYWlsLmNvbSIsImdpdGh1YiI6Imh0dHBzOi8vZ2l0aHViLmNvbS9HYXVyYXZibGFja2NvZGUiLCJpYXQiOjE2NTkzOTA0MzksImV4cCI6MTY1OTgyMjQzOX0.HfVTGQVIWUbN5WJI2SNQ1D7FdM3K9N9zt-R4sJncZ68');
    return (
      <Provider store={store}>
      <BrowserRouter>
        <Switch>
          {/* <PublicRoute restricted={false} component={SignIn} path="/" exact />
          <PublicRoute restricted={false} component={SignIn} path="/signin" exact />
          <PublicRoute restricted={false} component={Registration} path="/register" exact /> */}
          <PrivateRoute component={Dashboard} path="/dashboard" exact />
        </Switch>
      </BrowserRouter>
      </Provider>
    );
  }
}

export default App;
